    matl_in{ii} = rmfield(matl_in{ii}, setdiff(fns, fns_req));
    %add alpha fields if missing
    if ~isfield(matl_in{ii}, 'alpha')
        matl_in{ii}.alpha = 0;
    end;
    matl_in2(ii) = matl_in{ii};
    matl_in2(ii).stiffness_matrix = matl_in2(ii).stiffness_matrix(:);
end;
